import React, { Component } from "react";

const Pagination = (props) => {
  return (
    <nav aria-label="Page navigation example">
      <ul class="pagination">
        <li class="page-item">
          <a class="page-link" >
            1
          </a>
        </li>
        <li class="page-item">
          <a class="page-link" >
            2
          </a>
        </li>
        <li class="page-item">
          <a class="page-link" >
            3
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Pagination;
